import axios from "axios";
import { useState, useEffect } from "react";

const ComicDetailScreen = ({ resourceURI, comicName }) => {
  console.log("comicName: ", comicName);

  const [comicDetails, setComicDetails] = useState("");
  console.log("comicDetails: ", comicDetails);

  //   // let imagePath = characters[0].thumbnail.path + ".jpg";
  //   //   console.log("comicDetails: ", comicDetails);
  useEffect(() => {
    const url = { resourceURI };
    console.log("url: ", url.resourceURI);
    axios
      .get(url.resourceURI)
      .then((response) => {
        console.log("comic response", response);
        console.log("comicss: ", response.data.data.results[0].creators.items);
        setComicDetails(response.data.data.results[0].creators.items);
      })
      .catch((error) => {
        console.log("Error marvel: ", error);
      });
  }, []);

  const ComicDetails = () => {
    console.log("jaj");
    return (
      <div>
        {comicName.map((comicName) => (
          <div>
            <h2>{comicName.name}</h2>
          </div>
        ))}
      </div>
    );
  };

  return (
    <div>
      <h1>Comic Details</h1>
      <ComicDetails />
    </div>
  );
};

export default ComicDetailScreen;
